import React from 'react'
import { NavLink } from 'react-router-dom';

const Footer = () => {

  const navStyles = ({isActive}) => {
    return {
      color: isActive ? "#8CBCDB" : "#ffffff",
    };
  };

  return (
    <div className='p-3 px-5'>
      <div className="row">
        <div className="col-md-4">

        </div>
      </div>
    </div>
  )
}

export default Footer;
